import React from 'react'
import {SampleData} from './SampleData'
const SearchResult = () => {


    return (
        <div>
            <hr />
            <h1>{SampleData.findItemsByKeywordsResponse.searchResult.title[0]}</h1>
        </div>
    )
}

export default SearchResult
